import React from 'react';
import {Form} from "react-bootstrap";
import Button from "react-bootstrap/Button";

const Reg = (props) => {

    return (
        <div className={"registration_page"}>
            <Button className={"button_reg_auth"} onclick={props.toAuthorisation}>Authorisation</Button>

            <Form.Group className="mb-3" controlId="ID_control">
                <Form.Label>ID</Form.Label>
                <Form.Control type="text" placeholder="@000000" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="title_control">
                <Form.Label>Name</Form.Label>
                <Form.Control type="text" placeholder="Kitty" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="text_control">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
            </Form.Group>

            <Form.Group className="mb-3" controlId="text_control">
                <Form.Label>Repeat password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
            </Form.Group>
            
            <Button onclick={props.authorisation}>Go</Button>
        </div>
    );
};

export default Reg;
